	(7,'main architecture',' this page contains information about theu800 architecture andu800 software used within theu800 labu800. project best practices project best practices project best practices this page describes theu800 best practices foru800 howu800 rduu800 internal projects areu800 developed demoed andu800 eventually promoted . this concept isu800 based onu800 theu800 theory that nou800 oneu800 likes tou800 document andu800 that weu800 never have time foru800 documentation. this theory isu800 validated byu800 theu800 lack ofu800 documentation foru800 theu800 internal projects weu800\'veu800 been through wordpress dashboard rpms toxguide mmwrdemo mapapp etcu800. . this isu800 oku800 this isu800 natural with small teams whou800 have lots ofu800 projects. theu800 purpose ofu800 theu800 best practice isu800 tou800 identify theu800 minimul essential documentation that 1u800 lets usu800 know what weu800 have andu800 areu800 working onu800 2u800 points tou800 actual work that weu800 dou800 foru800 documentation. iu800u82eeu800. source code contains comments which isu800 theu800 real documentation documentation documentation documentation each project should create au800 page onu800 this wiki with minimal documentation. nou800 more than 30u800 minutes should beu800 spent creating this page andu800 itu800 should beu800 lightly updated asu800 necessary until theu800 project isu800 complete. ifu800 youu800 donu800\'tu800 have time tou800 create andu800 update this page youu800\'reu800 doing itu800 wrong. theu800 goal ofu800 this page isu800 notu800 tou800 have perfect oru800 even good documentation butu800 tou800 have useful documentation. initial template foru800 theu800 page 1u800 name 2u800 short description what dou800 youu800 want tou800 dou800 with theu800 project 3u800 source code location point tou800 theu800 repository 4u800 howu800 tou800 build & configure. foru800 iosu800 apps this isu800 simple-check outu800 project click build & runu800 - foru800 others t