	(8,'main architecture xcodetips',' au800 fewu800 hints foru800 linking xcode projects tou800 subversion repositories. 1u800 addu800 this line tou800 your .subversion config file global-ignores .ds_store .swpu800 .nibu800 build .pbxuser .perspective .perspectivev3 .mode1v3 .mode2v3 this makes subversion ignore allu800 ofu800 theu800 user-specific files that xcode generates andu800 theu800 build directory 2u800 addu800 au800 repository inu800 xcode using scmu800 repositories under theu800 options tabu800 check configure scmu800 automatically andu800 save files before scmu800 operations 3u800 open theu800 repository browser using scmu800 repositories select theu800 project youu800 want eu800u82egu800. google code iphonemobiletox andu800 click checkout . select some folder onu800 your local disk eu800u82egu800. source iphonemobiletox . this could take au800 fewu800 minutes. 4u800 nowu800 open theu800 project andu800 youu800 will seeu800 scmu800 prompts once youu800 change things eu800u82egu800. changing au800 file will place anu800 mu800 tou800 theu800 left ofu800 theu800 file inu800 project explorer . when youu800 areu800 finished commit your changes back tou800 theu800 repository byu800 selecting theu800 project root andu800 clicking scmu800 commit changes. '),
